INSERT INTO `pages` (`id`, `name`, `slug`, `s_description`, `priority`, `description`, `created_at`, `updated_at`) VALUES
	(1, 'Company Profile', 'company-profile', NULL, NULL, '<p>ECL System is true innovative manufacturer focus on tracking products for safety and fitness purpose, that includes personal gps tracker, gps watch, GPS card, pet tracker, bike tracker, vehicle gps tracker, OBD II tracker, fitness band. We are a group with more than 10 years experience in this industry, we are dedicated to bring reliable products and customised solutions with competitive price to clients worldwide. It is always a challenge to keep innovation, that is ECL System&rsquo;s mission and passion, we never stop. We always try to set the high standard for us and for the whole industry.&nbsp;We carry various customised&nbsp;solutions for different type of industry.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="https://cdn-asset.hipwee.com/wp-content/uploads/2017/06/hipwee-All-Hands-750x422.jpg" style="height:500px; width:100%" /></p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>Engineering Culture</h2>\r\n\r\n<p>ECL System have an experienced technical team with more than 80 engineers. Some of them come from top companies like Huawei, Lenovo, OPPO. They leverage their experience in the field of IOT/gps/wireless/wearable, and the engineering culture as well. Under the engineering culture, they build things solve the problems, they will speak up when thing is not right, they are fascinated by the best algorithm, architecture and craftsmanship of a new GPS device, they are excited about the implementation of the IOT cloud on Amazon AWS system. With this team, we are successful to delivery products and services to Huawei, G4S, Allianz, Orange, Etisalat...</p>\r\n\r\n<h2>Keep openness</h2>\r\n\r\n<p>Our culture of openness, collaboration, and continuous innovation is reflected in the products that we made. The open mindset promotes collaboration between the clients and us. We know our clients will use the devices to solve problems, they need the devices integrate with their existing system. An open architecture makes cross-platform interoperability possible. It&rsquo;s impossible to talk about openness without addressing the topic of open source. As a group, ECL System&#39;s engineers are bullish on the idea and reality of open source both in hardware and software, so much so that we open source pieces of technology that we&rsquo;ve built from scratch that other organisations can benefit from the work that we&rsquo;ve done. The open source parts are including PCBA, firmware, mobile app, API, IOT cloud platform.</p>\r\n\r\n<h2>Our Product Range</h2>\r\n\r\n<p>We are providing Safety and Fitness Solution by using GPS technology and all kind of sensiors</p>\r\n\r\n<ul>\r\n	<li>Personal Safety Solution for example GPS watch, Pet Tracker, GPS Card etc.</li>\r\n	<li>Asset Tracking for example Asset tracker, Vehicle Tracker and OBD Tracker</li>\r\n	<li>Fitness Tracking solution for example Fitness band and smart watch</li>\r\n	<li>Tracking Platform and mobile app</li>\r\n</ul>\r\n\r\n<h2>Our Services Range</h2>\r\n\r\n<p><strong>Hardware:</strong>&nbsp;With 8 years GPS tracking industry experience our in-house R&amp;D team provide full OEM/ODM services to our clients. Our clients have great ideas, we turn those ideas into commercially via n version products with a powerful combination of high quality and competitive pricing.&nbsp;<br />\r\n<br />\r\n<strong>Software:&nbsp;</strong>Software is critical to the success of a GPS tracking business. Our clients have grown significantly during the last 8 years, we have been challenged to fulfill different tracking and management requirements cross the world and delivered every time. Our team engineers can address any issue including: server software, web, API, iOS, and Android. This give us a unique ability to create and implement end to end projects. We have more than 300 commercial clients in more than 70 countries with 22 languages.&nbsp;<br />\r\n<br />\r\n<strong>Marketing:</strong>&nbsp;Instead of being a supplier for our clients, ECL System partners with them in a teamwork model that builds mutual success. We fight together and win together with our partners to win market share in their own markets. We help build their website to promote their brand and products. We are eager to see our clients succeed so we always listen to them and commit to agreed plans and actions when needed to help them sustain and grow their business!&nbsp;<br />\r\n<br />\r\nECL System &mdash; Giving life to your ideas!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="http://www.luminaprime8.co.uk/wp-content/uploads/2015/10/Bringing-Business-Ideas-to-Life-v2.jpg" style="height:300px; width:100%" /></p>', '2018-07-28 12:58:43', '2018-09-26 09:29:40'),
	(4, 'Management Profile', 'management-profile', NULL, NULL, '<h2>ORGANOGRAM OF ECL SYSTEM Ltd</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src="data:image/png;base64," style="height:534px; width:978px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2018-07-28 13:55:47', '2018-09-26 08:58:20'),
	(5, 'Partners', 'partners', NULL, NULL, '<p>Since our inception, our alliances have played a critical role in our drive for ecosystem-based innovation. Our service offerings and solutions across industry verticals are strengthened by alliances with global technology vendors, customers, and niche solution providers. And ECL helps its alliance partners with several International menufecturer and Technology Inventors.&nbsp;Knowing partners and their technology inside-out, we can rapidly tailor solutions to meet clients&rsquo; specific needs. We share best practices and collaborate on development with technology providers to help clients innovate and enhance performance.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src="data:image/png;base64," style="float:left; height:120px; margin-left:30px; margin-right:30px; width:281px" /><strong>Avi Networks</strong> is a company that provides software for the delivery of enterprise applications in data centers and clouds. <strong>Avi Networks </strong>was founded in 2012 and is headquartered in Santa Clara, California. Prior to Avi Networks, the founding team spent several years developing data center networking and storage solutions at Cisco Systems.</p>\r\n\r\n<p><strong>Avi Networks </strong>completes enterprises&rsquo; digital transformation with its intent-based application services. The Avi Vantage Platform, consisting of a Software Load Balancer, Intelligent WAF, and Elastic Service Mesh, is deployed across data centers and clouds, delivering better elasticity and intelligence. Customers enjoy 5X faster application rollouts, actionable analytics, and 50% lower cost</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Paladion </strong>was founded in 2000 and is headquartered in Reston, Virginia. For 17 years, <img src="data:image/png;base64," style="float:right; height:85px; margin-left:30px; margin-right:30px; width:384px" />Paladion has been actively managing cyber risk for customers from its six Cyber Security Operations Centers placed across the globe.</p>\r\n\r\n<p><strong>Paladion</strong> is a robust managed security service provider, with over a decade of experience, trusted by organizations from around the globe from Asia to the US to EMEA. Currently, they are actively servicing more than 700 satisfied clients while continuing to truly transform customer experience, with IT security as our top priority. <strong>Paladion</strong> assists its Partners to improve their business operations by leveraging its industry-wide experience, expertise in cutting-edge technology and an extensive portfolio of services.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src="data:image/png;base64," style="float:left; height:63px; margin-left:30px; margin-right:30px; width:384px" /><strong>&nbsp;Procera Networks, Inc.</strong> the global intelligent policy enforcement company, that designs and sells Network Intelligence solutions based on deep packet inspection (DPI) technology.</p>\r\n\r\n<p><strong>Procera</strong> was incorporated in 2002 in California. <strong>Procera</strong> offers Network Intelligence solutions based on their version of deep packet inspection (DPI) called the DataStream Recognition Definition Language (DRDL). DRDL uses properties of applications for identification purposes, and this allows operators to manage subscriber traffic based on the application, similar to many DPI products. <strong>Procera</strong> offers over 100 use cases in Analytics, Traffic Management, Policy Enforcement, and Service Provider Compliance.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src="data:image/png;base64," style="float:left; height:50px; margin-left:5px; margin-right:5px; width:160px" />&nbsp; SAP Business One: SAP Business One is business management software (ERP) designed for small and medium-sized enterprises, sold by the German company SAP SE. As an&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ERP solution,&nbsp; &nbsp; &nbsp;it aims to automate key business functions in financials, operations, and human resources.&nbsp;<a href="https://www.sap.com/businessone" target="_blank">Clink Me</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src="data:image/png;base64," style="float:left; height:63px; margin-left:5px; margin-right:5px; width:160px" />&nbsp;SOPHOS: Sophos Group plc is a security software and hardware company. Sophos develops products for communication endpoint, encryption, network security, email security,&nbsp; &nbsp;mobile&nbsp; security and unified threat management. Sophos is primarily focused on providing security software to the mid market and pragmatic enterprise from 100 to 5000 Seat&nbsp; &nbsp;organizations.&nbsp;<a href="https://www.sophos.com" target="_blank">Click</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src="data:image/png;base64," style="float:left; height:63px; margin-left:5px; margin-right:5px; width:160px" />&nbsp;FORTINET: Fortinet is an American multinational corporation headquartered in Sunnyvale, California. It develops and markets cybersecurity software, appliances and services, such&nbsp; &nbsp;as&nbsp; firewalls, anti-virus, intrusion prevention and endpoint security, among others. It is the fourth-largest network security company by revenue.&nbsp;<a href="http://www.fortinet.com" target="_blank">Click</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src="data:image/jpeg;base64," style="float:left; height:63px; margin-left:5px; margin-right:5px; width:160px" />&nbsp;Axis Communications&nbsp; Axis is the market leader in network video. We invented the world&rsquo;s first network camera back in 1996 and we&rsquo;ve been innovators in video surveillance ever&nbsp; &nbsp; &nbsp;since,&nbsp; &nbsp;increasing the&nbsp;security of millions of people worldwide and helping to meet the growing need for a smarter, safer world.&nbsp;With the help of 90,000 partners, spanning 179&nbsp; &nbsp;countries,&nbsp; we&rsquo;ve&nbsp; &nbsp;delivered a series of groundbreaking products and many industry firsts. And, we look forward to pioneering many more.&nbsp;<a href="https://www.axis.com" target="_blank">Click</a>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2018-07-28 13:58:24', '2018-09-26 09:45:15'),
	(6, 'MISSION & VISION', 'mission-vision', 'Target to be the most preferred to global clients, so as to maintain our reputation for credibility and integrity with our customer vendors and employees', 1, '<p>Target to be the most preferred to global clients, so as to maintain our reputation for credibility and integrity with our customer vendors and employees.&nbsp;In range of service dealing with success are sure result of commitment of delivery &amp; quality, this will bring our valued customers in trust circles. We will try to take us to a position where satisfied customer will be our team members and healthy business prevail for times to come.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>OUR MISSION</strong></h3>\r\n\r\n<p><img src="data:image/jpeg;base64," style="float:left; height:128px; width:384px" /></p>\r\n\r\n<p>Our <strong>MISSION</strong> is to build seamless and integrated technology capabilities across dimensions &ndash; the digital, the physical, the convergent, and everything in between. Empowering people through ITES and enhance performance of the business.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>OUR VISSION</strong></h3>\r\n\r\n<hr />\r\n<p><img src="data:image/png;base64," style="float:right; height:128px; width:381px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Our <strong>VISION</strong> is to be the market leader for Converged ICT ecosystem, information and communication technology with network services, Security and consultancy, IT services, software services.</p>\r\n\r\n<p>&nbsp;</p>', '2018-09-30 05:23:47', '2018-11-24 05:59:55'),
	(7, 'VALUES & BELIEVE', 'values-believe', 'Inspired by our vision, driven by our mission, and underpinned by our values, we will solve the most complex challenges and deliver a better service.', 3, '<h3><strong>VALUES</strong></h3>\r\n\r\n<hr />\r\n<p><img src="data:image/jpeg;base64," style="float:right; height:300px; width:323px" />Inspired by <em>our</em> vision, driven by <em>our</em><em> </em>mission, and underpinned by <em>our values</em><em>,</em> we will solve the most complex challenges and deliver a better service. Delivering innovative infrastructure, designs, and security solutions to enable a sustainable, safer, smarter, and connected. Through the regular application of these six principles, we continue to provide values to our customers, and we consistently meet our goals.</p>\r\n\r\n<p><strong>ACCOUNTABILITY</strong> Team members are empowered to make right decision. We are fiscally responsible in our all dealings and accept responsibility for results</p>\r\n\r\n<p><strong>INNOVATION &amp; DIVERSITY </strong>We are committed to the continuous improvement of the programs, tools, and creative solutions for the benefit of the independent customer. We believe in meaningful productive change.</p>\r\n\r\n<p><strong>INTEGRITY</strong> We maintain professional ethics. Every interaction is executed with high level of honesty, respect and professionalism</p>\r\n\r\n<p><strong>CHALLENGES</strong> We challenge ourselves to be best, findings new ways to improve everything we do</p>\r\n\r\n<p><strong>QUALITY</strong> We plan, analyze and improve every process where necessary. We are confidence to ensure Quality of Service.</p>\r\n\r\n<p><strong>COLLABORATION </strong>Our success is dependent on that of our business partners. To achieve shared goals, we extend beyond our walls.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>BELIEVE</strong></h3>\r\n\r\n<hr />\r\n<p>We believe, through the regular application of these five principles, we could achieve our success.</p>\r\n\r\n<p><img src="data:image/jpeg;base64," style="float:left; height:303px; width:300px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>DETERMINATION</strong> Excellence in everything we do</p>\r\n\r\n<p><strong>RESPONSIVENESS </strong>Bing creative and open&ndash;minded, pursuing growth and learning</p>\r\n\r\n<p><strong>TEAMWORK</strong> We act as a team, listening and involving others</p>\r\n\r\n<p><strong>HONESY</strong> Building lasting relationships with integrity</p>\r\n\r\n<p><strong>CUSTOMER SERVICE</strong> Being there for our clients, becoming our &lsquo;in-house&rsquo; translation team</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2018-09-30 05:25:03', '2018-11-24 05:57:42'),
	(8, 'OUR PRACTICE', 'our-practice', 'As business grows, there will need to change to adapt to new circumstances.', 2, '<h3><strong>OUR PRACTICE</strong><img src="data:image/jpeg;base64," style="float:right; height:277px; margin-left:20px; margin-right:20px; width:478px" /></h3>\r\n\r\n<p>As business grows, there will need to change to adapt to new circumstances. Businessman can experiment with different ways of working to see which suits for his business best. But this approach is inefficient and may lead him to make inappropriate decisions. A far more effective way of making changes is to look at how successful businesses operate and to introduce their ways of working into his business. Evaluating how his operations compare with the most effective and profitable enterprises, and then using their most successful elements - the &quot;best practice&quot; in a businessman&rsquo;s own business, can make a big difference. It involves keeping up to date with the ways that successful businesses operate - in your sector and others - and measuring your ways of working against those used by the market leaders.</p>\r\n\r\n<p>We also practice some of as follows to increase our business growth-</p>\r\n\r\n<p><strong>Improve the Corporate Credibility</strong></p>\r\n\r\n<ul>\r\n	<li>Business operation ethics improvement</li>\r\n	<li>Work with honesty</li>\r\n	<li>Establish customer trust</li>\r\n	<li>Respond more quickly to innovations in your sector</li>\r\n	<li>Clear and careful strategic planning</li>\r\n</ul>\r\n\r\n<p><strong>Secure Technology</strong></p>\r\n\r\n<ul>\r\n	<li>Cause investigation before involvement</li>\r\n	<li>Improvement of accommodation</li>\r\n	<li>Reviewing appropriate national and international standards</li>\r\n	<li>Technology revivification and check back</li>\r\n	<li>Prevent recurrence</li>\r\n</ul>\r\n\r\n<p><strong>Strength Competition</strong></p>\r\n\r\n<ul>\r\n	<li>Avoid unhealthy business</li>\r\n	<li>Become more competitive</li>\r\n	<li>Use technology more effectively</li>\r\n	<li>Improve the skills of your workforce</li>\r\n	<li>Reduce waste and improve quality</li>\r\n	<li>Reduce costs and become more efficient</li>\r\n</ul>\r\n\r\n<p><strong>Strategic Management</strong></p>\r\n\r\n<ul>\r\n	<li>Involving employees in the development of the business</li>\r\n	<li>Adopting flexible working and policies that encourage equality and diversity</li>\r\n	<li>Establish system of risk recovery</li>\r\n	<li>First safety, Accident ZERO</li>\r\n	<li>Standard Compliance</li>\r\n</ul>', '2018-09-30 05:25:43', '2018-11-24 05:58:22'),
	(9, 'Training', 'training', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry.', NULL, '<p>Education is any kind of knowledge transitioned into learning.</p>\r\n\r\n<p>LIVEWIRE promote niche training in IT, Electronics &amp; Electricals creating experts for emerging technology industries and specialist technology jobs. A part of CADD Centre, which is Asia&#39;s largest CAD/CAM/CAE training institute. LIVEWIRE is present in 100 locations across India and 6 Countries.</p>', '2018-12-08 11:23:36', '2018-12-09 17:00:47');
