INSERT INTO `products` (`id`, `name`, `brand_id`, `model_no`, `slug`, `price`, `description`, `technical_features`, `general_features`, `safety_and_veri`, `image`, `image2`, `image3`, `image4`, `status`, `order`, `created_at`, `updated_at`) VALUES
	(1, 'Controller', 3, 'VHFO V2', 'vhfo-v2', NULL, '<p>This is a Controller.</p>', '<ol>\r\n	<li>Area Coverage-Room Void</li>\r\n	<li>&nbsp; &nbsp;a. 3.600 Sq.Ft.- Dedicated Connection</li>\r\n	<li>&nbsp; &nbsp; b. 7,200 Sq.Ft.- Looped Connection</li>\r\n	<li>Can support upto 12 transducers in a Dedicated Connection &amp; 24 in a Looped Connection.</li>\r\n	<li>Auto and Manual Modes of Operation.</li>\r\n	<li>Single Driver for all transducers.</li>\r\n	<li>5 Wave Speeds, 4 Wave Densities and 4 Frequency Bands of Operation</li>\r\n	<li>Transducer Sound Output Verification and Analysis</li>\r\n</ol>', '<ol>\r\n	<li><strong>Transformer Rating&nbsp;:&nbsp;</strong> 25 V.A. UL &amp; CE Approved</li>\r\n	<li><strong>Power Supply &nbsp;:&nbsp;</strong>230 V AC/50 HZ or 14 Volts AC</li>\r\n	<li><strong>Dimensions (WidthXDepthXHeight) &nbsp;:&nbsp;</strong>200 mm x 300 mm x 85 mm</li>\r\n	<li><strong>Weight&nbsp;:&nbsp;</strong> 3.5 Kgs Approximately</li>\r\n	<li><strong>Mounting &nbsp;:&nbsp;</strong>Wall/ Table Mounting</li>\r\n	<li><strong>Power Consumption &nbsp;:&nbsp;</strong>15 Watts Approximately</li>\r\n</ol>', '<ol>\r\n	<li>100% Output Verification with the help of Maser Wave Analyzer Hardware and Software</li>\r\n	<li>Safety Compliance as per IRPA (International Radiation Protection Association) Geneva.</li>\r\n	<li>Record and Report 1/3 rd Octave Band Frequencies thereby ensuring human safety as per IRPA Guidelines</li>\r\n	<li>Record and Report Individual Frequencies alongwith corresponding sound pressure levels.</li>\r\n</ol>', 'images/Products/1538543153.jpg', 'images/Products/15388214942.jpg', NULL, NULL, 1, 100, '2018-10-03 05:05:53', '2018-10-13 01:25:46'),
	(3, 'ENVIROMUX Liquid Detection Sensor', 4, 'E-LDS10', 'enviromux-liquid-detection-sensor', NULL, '<p><strong>ENVIROMUX Server Environment Monitoring System Liquid Detection Sensor.</strong></p>\r\n\r\n<p>For warning of flooding.<br />\r\n<br />\r\n&bull; Includes a 10 feet long Water Sensor Cable.<br />\r\n&bull; Select the desired length of a 2-Wire Cable (used to connect the sensor to ENVIROMUX-SEMS-16 or SERIMUX-S-x) to order from the list below (5 to 100 feet) at&nbsp;no additional cost.</p>', NULL, '<ol>\r\n	<li>Detects liquid depth &gt;0.1&quot;.</li>\r\n	<li>&bull; Minimum puddle: 0.6&quot; diameter.</li>\r\n	<li>&bull; 100% waterproof electronics.</li>\r\n	<li>&bull; Detects any liquid or moisture, except deionized water.</li>\r\n	<li>&bull; RJ45 connector.</li>\r\n	<li>&bull; Supports CAT-5/5e/6 cable up to 1,000 ft. (not included)</li>\r\n	<li>&bull; Available 2-wire cable (y) lengths: 5/10/20/50/100 feet.</li>\r\n</ol>', NULL, 'images/Products/1538822871.jpg', NULL, NULL, NULL, 1, 20, '2018-10-06 04:47:51', '2018-10-06 04:47:51'),
	(4, 'ENVIROMUX Temperature/Wide Range Humidity/Dew Point Sensor', 4, 'E-STHS-99', 'enviromux-temperature-wide-range-humidity-dew-point-sensor', NULL, '<p><strong><em>E-STHS-99: Temperature, wide-range humidity (up to 99% RH) and dew-point combination sensor&nbsp;</em></strong></p>\r\n\r\n<p>for&nbsp;ENVIROMUX server environment monitoring system&nbsp;</p>', NULL, '<ol>\r\n	<li>&bull; Applications from 32&deg;F to 122&deg;F</li>\r\n	<li>&bull; Accurate to within &plusmn;2&deg;F (0&deg;C to 50&deg;C, &plusmn;1&deg;C)</li>\r\n	<li>&bull; 20% to 80% relative humidity, &plusmn;3%</li>\r\n	<li>&bull; 10% to 90% relative humidity, &plusmn;4%</li>\r\n	<li>&bull; 0% to 99% relative humidity, &plusmn;5%</li>\r\n	<li>&bull;&nbsp;Supports dew point measurement.</li>\r\n	<li>&bull; High resistance to external influences on the cable due to digital output signal.</li>\r\n	<li>&bull; Re-calibration is not necessary after initial set-up.</li>\r\n	<li>&bull; RJ45 connector.</li>\r\n	<li>&bull; Supports CAT-5/5e/6 cable up to 1,000 ft.(not included)</li>\r\n	<li>&bull;&nbsp;Current consumption: 10mA @ 5VDC.</li>\r\n	<li>&bull; Powered by ENVIROMUX-2D/5D/16D.</li>\r\n	<li>&bull;&nbsp;Regulatory approvals: CE, RoHS</li>\r\n	<li>&bull; Compatible with ENVIROMUX-FSC Fiber Converter/Extender (Use to extend sensor up to 1.2 miles (2 km) from the ENVIROMUX unit</li>\r\n</ol>', NULL, 'images/Products/1538823933.jpg', 'images/Products/15388239332.jpg', NULL, NULL, 1, 30, '2018-10-06 04:58:44', '2018-10-06 05:12:34'),
	(5, 'Vibration Sensor - Registers Movement & Shocks', 4, 'E-VSSB', 'vibration-sensor---registers-movement-&-shocks', NULL, '<p><strong>Environment Monitoring System Vibration &amp; Glass Break Sensors</strong></p>\r\n\r\n<p><strong>Motion / Intrusion / Vibration Sensors compatible with ENVIROMUX&reg;&nbsp;</strong><a href="http://www.networktechinc.com/environment-monitor-2d.html">E-2D</a>,&nbsp;<a href="http://www.networktechinc.com/environment-monitor-5d.html">E-5D</a>&nbsp;and&nbsp;<a href="http://www.networktechinc.com/environment-monitor-16d.html">E-16D</a></p>', NULL, '<ol>\r\n	<li>E-VSSB</li>\r\n	<li>For registering movement and shocks - sensed through surface to which it is mounted.</li>\r\n	<li>Trigger duration: 3.1 to 4.1 seconds</li>\r\n	<li>RJ45 connector for connecting to an E-2D/5D/16D.\r\n	<ol>\r\n		<li>Maximum cable length: 1,000 ft (305 m)</li>\r\n	</ol>\r\n	</li>\r\n	<li>Voltage Supply: 5VDC</li>\r\n	<li>Current Consumption: 15mA</li>\r\n	<li>Operating temperature: 32 to 104&deg;F (0 to 60&deg;C)</li>\r\n	<li>Storage temperature: -22 to 140&deg;F (-30 to 60&deg;C)</li>\r\n	<li>Relative Humidity: 17 to 90% non-condensing RH.</li>\r\n	<li>Powered by E-2D/5D/16D.</li>\r\n	<li>Compatible with E-2D/5D/16D.</li>\r\n	<li>Mounting bracket included.</li>\r\n	<li>Dimensions without bracket WxDxH: 2x2.5x1.28 in (51x64x33 mm)</li>\r\n	<li>Dimensions without bracket WxDxH: 3.75x2.5x1.34 in (95x64x34 mm)</li>\r\n	<li>Regulatory approvals: CE, RoHS</li>\r\n</ol>', NULL, 'images/Products/1538824712.jpg', NULL, NULL, NULL, 1, 50, '2018-10-06 05:18:32', '2018-10-06 05:19:43'),
	(6, 'Low-Cost Infrared Motion Sensor – CE Compliant', 4, 'E-IMD-LC', 'low-cost-infrared-motion-sensor-–-ce-compliant', NULL, '<p><strong>Environment Monitoring System Motion Detection Sensors</strong></p>\r\n\r\n<p><strong>Motion/Intrusion Sensors compatible with ENVIROMUX&reg;&nbsp;<a href="http://www.networktechinc.com/environment-monitor-2d.html">E-2D</a>,&nbsp;<a href="http://www.networktechinc.com/environment-monitor-5d.html">-5D</a>&nbsp;and&nbsp;<a href="http://www.networktechinc.com/environment-monitor-16d.html">E-16D</a></strong></p>', NULL, '<ol>\r\n	<li>Registers movement in area covered: 39x39 ft (12x12 m), 110&deg; wide.</li>\r\n	<li>Condition display via LED.</li>\r\n	<li>Adjustable sensitivity.</li>\r\n	<li>Intelligent logic control prevents false alarms.</li>\r\n	<li>Wall mount or hang in a corner.</li>\r\n	<li>Pulse count adjustment.</li>\r\n	<li>Good RFI protection.</li>\r\n	<li>Screw terminal.\r\n	<ol>\r\n		<li>Connect to digital input or RJ45 sensor ports on an ENVIROMUX system.\r\n		<ol>\r\n			<li>To connect to the digital inputs, use a 22 AWG 2-wire cable. Connect the other end to the sensor screw terminal.</li>\r\n			<li>To connect to the RJ45 inputs, use CAT5/5e/6 cable terminated at one end with RJ45 connector. Connect the un-terminated end to the sensor screw terminal.</li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n	<li>Current consumption: 18mA @ 12VDC.</li>\r\n	<li>Powered by the E-2D/5D/16D.</li>\r\n	<li>Includes mounting bracket for installing the sensor to a ceiling or wall.</li>\r\n	<li>Regulatory approvals: CE, RoHS.</li>\r\n</ol>', NULL, 'images/Products/1538824909.jpg', NULL, NULL, NULL, 1, 10, '2018-10-06 05:21:49', '2018-10-06 05:21:49'),
	(7, 'Fingerprint Access Control System', 4, 'E-FACS', 'fingerprint-access-control-system', NULL, '<p>Environment Monitoring System Access Control<br />\r\nAccess Control Systems &amp; Accessories compatible with E-2D, E-5D and E-16D</p>', NULL, '<ul>\r\n	<li>Biometric fingerprint reader with durable and highly accurate optical sensor.</li>\r\n	<li>Quick single touch, one second user recognition.</li>\r\n	<li>Alarm, door, and egress button contacts.</li>\r\n	<li>Selectable 26-bit or 34-bit Wiegand data input and output.</li>\r\n	<li>Audio-visual indicators for acceptance and rejection of valid/invalid fingerprints.</li>\r\n	<li>Stores up to 600 fingerprint templates and 15,000 transactions.</li>\r\n	<li>Built-in serial, USB, and Ethernet ports for RS232/RS485, USB Host, and TCP/IP communication.</li>\r\n	<li>Includes the following management software:\r\n	<ul>\r\n		<li>Access Control Software\r\n		<ul>\r\n			<li>Import and export all user data, and set up sensor settings and delay.</li>\r\n			<li>Keeps logs of all user entries.</li>\r\n		</ul>\r\n		</li>\r\n		<li>Attendance Management Software\r\n		<ul>\r\n			<li>Configure employee schedules and monitor and download access logs.</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n	<li>Tamper-proof.</li>\r\n	<li>IP65 rated.</li>\r\n	<li>Compatible EM cards (E-RFID-CRD10) and keyfobs (E-RFID-KYFB10) are available in packs of ten.</li>\r\n	<li>Current consumption: 200mA @ 12VDC.</li>\r\n	<li>Powered by E-2D/5D/16D.</li>\r\n	<li>Operating temperature: 14 to 140&deg;F (-10 to 60&deg;C).</li>\r\n	<li>Operating humidity: 10 to 90% non-condensing RH.</li>\r\n	<li>Dimensions (WxDxH): 2.87x1.38x5.83 in (73x35x148 mm).</li>\r\n	<li>Regulatory approvals: CE, FCC, RoHS.</li>\r\n</ul>', NULL, 'images/Products/1538825188.jpg', NULL, NULL, NULL, 1, 40, '2018-10-06 05:26:28', '2018-10-06 05:27:40'),
	(8, 'USB 3G Modem', 4, 'E-3GU-4', 'usb-3g-modem', NULL, '<ul>\r\n	<li>Sends SMS text messages to a pager or cell phone when a sensor goes out of range of a configurable threshold.</li>\r\n	<li>Use to access the ENVIROMUX web interface.\r\n	<ul>\r\n		<li>The SIM card must have a &quot;public&quot; IP address for full control of the<br />\r\n		E-2D/5D/16 through the modem.</li>\r\n	</ul>\r\n	</li>\r\n	<li>SIM card supporting SMS messaging required (not included).</li>\r\n	<li>Supports third generation (3G) digital cellular standards.</li>\r\n	<li>USB 2.0 stick with Male USB Type A connector</li>\r\n	<li>3G network band: HSPA+/HSUPA/HSDPA/HSPA/UMTS(WCDMA)-2100 MHz.</li>\r\n	<li>2G network band: GSM/GPRS/EDGE-850/900/1800/1900 MHz</li>\r\n	<li>When connected to the ENVIROMUX system, protrudes 2.68&quot; from the edge of the case.</li>\r\n	<li>Compatible with E-2D/5D/16D.\r\n	<ul>\r\n		<li>Not compatible with E-SEMS-16U.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Will ship with either a white or black case.</li>\r\n	<li>Regulatory approvals: CE, RoHS</li>\r\n</ul>', NULL, '<ul>\r\n	<li>Sends SMS text messages to a pager or cell phone when a sensor goes out of range of a configurable threshold.</li>\r\n	<li>Use to access the ENVIROMUX web interface.\r\n	<ul>\r\n		<li>The SIM card must have a &quot;public&quot; IP address for full control of the<br />\r\n		E-2D/5D/16 through the modem.</li>\r\n	</ul>\r\n	</li>\r\n	<li>SIM card supporting SMS messaging required (not included).</li>\r\n	<li>Supports third generation (3G) digital cellular standards.</li>\r\n	<li>USB 2.0 stick with Male USB Type A connector</li>\r\n</ul>', NULL, 'images/Products/1538826061.jpg', NULL, NULL, NULL, 1, 70, '2018-10-06 05:41:01', '2018-10-06 05:41:01'),
	(13, 'Tripod Turnstile', 2, 'SST1020A', 'turnstile-C8J', NULL, '<p><strong>Stainless Steel Half Height Turnstile </strong></p>\r\n\r\n<p>Auto tripod turnstile adopts the stepping motor to drive the equipment. It is used in the entrance of factories and communities. Maxview brings in advanced and experience to improve. And it can prevent passing multiple people for one card reading and manual force to the arm. According to the specific requirement, it can work with door access control and time attendance system.</p>', NULL, '<ul>\r\n	<li>Beautiful design, antirust and durable.</li>\r\n	<li>Standard Interface, support external card / fingerprint readers</li>\r\n	<li>Designed with stainless steel and water proof</li>\r\n	<li>Self-check function</li>\r\n	<li>Auto recovery</li>\r\n</ul>', NULL, 'images/Products/1542539683.jpg', NULL, NULL, NULL, 1, 90, '2018-11-18 11:14:43', '2018-11-18 11:51:25'),
	(14, 'Flap Barrier Turnstile', 2, 'SSF2010', 'flap-barrier-turnstile-9hy', NULL, '<p><strong>Stainless Steel Half Height </strong></p>\r\n\r\n<p>Flap Barrier Flap Barrier turnstile adopts the stepping motor to drive the equipment. It is used in the entrance of factories and communities. Maxview brings in advanced and experience to improve. And it can prevent passing multiple people for one card reading and manual force to the arm. According to the specific requirement, it can work with door access control and time attendance system.</p>', NULL, '<ul>\r\n	<li>Beautiful design</li>\r\n	<li>antirust and durable</li>\r\n	<li>Standard Interface, support external card / fingerprint readers</li>\r\n	<li>Designed with stainless steel and water proof</li>\r\n	<li>Self-check function &bull; Auto recovery</li>\r\n</ul>', NULL, 'images/Products/1542542313.jpg', NULL, NULL, NULL, 1, 80, '2018-11-18 11:58:33', '2018-11-18 11:58:33'),
	(15, 'Half Height Turnstile', 2, 'SSF2050', 'half-height-turnstile-tp8', NULL, '<p><strong>Stainless Steel Half Height Turnstile </strong></p>\r\n\r\n<p>SSF2050 is designed to provide unsupervised access control for office or buildings. The impenetrable construction eliminates any unauthorized access to restricted area. To gain authorized passage through SSF2050, the user must present a valid card / fingerprint for the access control system. Upon presentation of the valid card / fingerprint, SSF2050 will unlock and allow the user to pass through the direction requested. The turnstile can also work with push button and face recognition access control systems.</p>', NULL, '<ul>\r\n	<li>Stainless steel machine case</li>\r\n	<li>Standard Interface, support external card / fingerprint readers</li>\r\n	<li>Infrared light detecting, Alarming when illegal infiltration or tailing</li>\r\n	<li>Clamping avoid</li>\r\n</ul>', NULL, 'images/Products/1542543359.jpg', NULL, NULL, NULL, 1, 110, '2018-11-18 12:15:59', '2018-11-18 12:15:59'),
	(16, 'Full Height Turnstile Gate', 2, 'SSH6030', 'full-height-turnstile-gate-KmW', NULL, '<p><strong>Stainless Steel Full Height Turnstile </strong></p>\r\n\r\n<p>SSH6030 is designed to provide unsupervised access control for office or buildings. The impenetrable construction eliminates any unauthorized access to restricted area. To gain authorized passage through SSH6030, the user must present a valid card / fingerprint for the access control system. Upon presentation of the valid card / fingerprint, SSH6030 will unlock and allow the user to pass through the direction requested. The turnstile can also work with push button and face recognition access control systems.</p>', NULL, '<ul>\r\n	<li>Stainless steel machine case</li>\r\n	<li>Standard Interface, support external card / fingerprint readers</li>\r\n	<li>Adjustable access way</li>\r\n</ul>', NULL, 'images/Products/1542543851.jpg', NULL, NULL, NULL, 1, 130, '2018-11-18 12:24:11', '2018-11-18 12:24:11'),
	(17, 'Car Park Barrier Systems', 2, 'D107', 'car-park-barrier-systems-hwy', NULL, '<p>Make the right choice for your property. Huntaway Security are leading suppliers of car park barriers, helping you better control access to your property. Designed for durability and reliability, they&rsquo;re a smart investment for any public or private carpark.</p>\r\n\r\n<p>Huntaway Security recognises the importance of high-quality access control systems to every property. We provide a comprehensive range of products at some of the most competitive prices in Singapore, making it simpler for site managers and building owners to manager entry to their car parks. When you&rsquo;re looking for a high-quality security solution for your property at an affordable price, look no further than our catalogue.</p>', '<ul>\r\n	<li>Drive Steady</li>\r\n	<li>Lower Noise</li>\r\n	<li>Structures Compact</li>\r\n	<li>Self-Locking</li>\r\n</ul>', '<h2>Providing the feature you need</h2>\r\n\r\n<p>Our automatic vehicle barriers are able to be monitored and controlled remotely from the security guardhouse, ensuring faster and more convenient access to the property for authorised personnel. An effective access control solution for vehicle movements to and from the carpark, the Huntaway range is equipped with powerful 60 and 70W motors and reliable mechanisms, delivering the quality and speed of operation you&rsquo;ve been looking for. Ideal for high traffic areas and industrial lots, their durable construction keeps maintenance to a minimum, providing a comprehensive and no-fuss access solution.</p>', NULL, 'images/Products/1542545539.jpg', 'images/Products/15425445092.jpg', 'images/Products/15425455393.jpg', NULL, 1, 120, '2018-11-18 12:35:10', '2018-11-18 12:52:19'),
	(18, 'Aspirating Smoke Detection System(VESDA)', 1, 'VLF-250', 'aspirating-smoke-detection-system(vesda)-4au', NULL, '<p>The VESDA VLF-250 detector is a very early warning smoke detector<br />\r\ndesigned to protect small, business-critical environments of less than 250 m2<br />\r\n(2,690 sq. ft.).<br />\r\nThe detector works by continually drawing air into sampling holes in a pipe<br />\r\nnetwork. The air is filtered and passed into a detection chamber where light<br />\r\nscattering technology detects the presence of very small amounts of smoke.<br />\r\nDetector status information is communicated on the detector display and via<br />\r\nrelays or optional interface cards.</p>', NULL, '<p><strong>Features</strong><br />\r\n&bull; Out-of-the-Box Installation and<br />\r\nCommissioning<br />\r\n&bull; Ultrasonic Airflow Sensing<br />\r\n&bull; Laser-Based Absolute Smoke Detection<br />\r\n&bull; Pre-engineered pipe network designs<br />\r\n&bull; Programmable Alarm Thresholds<br />\r\n&bull; Clean air barrier optics protection<br />\r\n&bull; Instant Recognition Display<br />\r\n&bull; Instant Fault Finder&trade;<br />\r\n&bull; AutoLearn&trade; Smoke<br />\r\n&bull; AutoLearn&trade; Flow<br />\r\n&bull; Field Service Access Door<br />\r\n&bull; Multiple Event Logging in separate logs<br />\r\n&bull; Event log &ndash; up to 18000 events<br />\r\n&bull; Offline/online configuration capability<br />\r\n&bull; Up to 250 m2 (2,690 sq. ft.) coverage*</p>', NULL, 'images/Products/1542544841.png', NULL, NULL, NULL, 1, 140, '2018-11-18 12:40:41', '2018-11-18 12:40:41'),
	(19, 'VESDA', 1, 'VLP', 'vesda-2Hq', NULL, '<p>The VESDA VLP detector is the central element of the VESDA ASD product range.<br />\r\nUsing unique detection principles, the VLP has an alarm sensitivity range of 0.005%&ndash;<br />\r\n20% obscuration/m (0.0015%&ndash;6.25% obscuration/ft). The VLP is classed as a &ldquo;Very<br />\r\nEarly Warning Smoke Detector&rdquo;, which means that it detects fire at the earliest possible<br />\r\nstage and reliably measures very low to extremely high concentrations of smoke.<br />\r\n<strong>How It Works</strong><br />\r\nAir is drawn into the VLP through a network of air sampling pipes by a high efficiency<br />\r\naspirator. Each inlet pipe has an airflow sensor that monitors airflow changes in the<br />\r\npipes. Air is exhausted from the VLP and may be vented back into the protected zone.<br />\r\nInside the VLP, a sample of air is passed into the laser detection chamber. Ultra-fine air<br />\r\nfiltration provides very clean air to protect the optical surfaces inside the detector from<br />\r\ncontamination.<br />\r\nThe detection chamber uses a stable Class 1 laser light source and carefully positioned<br />\r\nsensors to achieve the optimum response to a vast range of smoke types.<br />\r\nThe status of the detector, and all alarm, service and fault events, are transmitted to<br />\r\ndisplays and external systems via VESDAnet.</p>', NULL, '<p><strong>Features</strong><br />\r\n&bull; Wide sensitivity range<br />\r\n&bull; Laser based smoke detection<br />\r\n&bull; 4 configurable alarm levels<br />\r\n&bull; High efficiency aspirator<br />\r\n&bull; Four inlet pipes<br />\r\n&bull; Airflow supervisor per sampling pipe<br />\r\n&bull; Clean air barrier optics protection<br />\r\n&bull; Easy to replace air filter<br />\r\n&bull; 7 programmable relays<br />\r\n&bull; VESDAnet&trade;<br />\r\n&bull; AutoLearn&trade;<br />\r\n&bull; Referencing<br />\r\n&bull; Event log<br />\r\n&bull; Modular design<br />\r\n&bull; Recessed mounting option</p>', NULL, 'images/Products/1543665782.jpg', NULL, NULL, NULL, 1, 150, '2018-11-18 12:43:23', '2018-12-01 12:03:03');
