INSERT INTO `projects` (`id`, `project_type_id`, `title`, `slug`, `introduction`, `provided`, `challanges_overcome`, `status`, `created_at`, `updated_at`) VALUES
	(1, 1, 'GTCL Data Recovery Center', 'gtcl-data-recovery-center', '<p>The customer expressed a desire to gain an assessment of the current operational status of the company&rsquo;s data center, along with data center infrastructure management recommendations which could provide multi-generational support as the company&rsquo;s IT needs continue to evolve. GTCL spoken about the services from qualified vendors experienced in providing, installing and configuring a standard infrastructure which address the following needs-</p>\r\n\r\n<ul>\r\n	<li>Highly available 24/7 operation</li>\r\n	<li>Deployment of scalable technologies allowing for growth</li>\r\n	<li>Automation and consolidation of IT systems management</li>\r\n	<li>Optimization and Control of Cooling and Environment factors</li>\r\n	<li>Redundant systems</li>\r\n	<li>Fire detection and protection</li>\r\n</ul>\r\n\r\n<p>Reduction of power consumption and operation costs</p>', '<p><strong>Power: redundancy and backup</strong></p>\r\n\r\n<p>Power, the most important detail of a data center. All of servers and colocation equipment run off of dedicated power source, power is the sacred grail of every data center. More to the point, beyond simply being able to provide power to colocation equipment through PDU&rsquo;s, every data center worth its salt needs to have redundant/backup power sources to ensure server and overall service uptime. Without redundant power supplies, i.e. backup power, a data center is only as good as the local city grid it operates off of. And we know, the city grids fail often. The following equipment&rsquo;s related the power system-</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>UPS:</strong>&nbsp;Uninterruptible Power Source is always running off of battery power and the battery is continuously being recharged. It is an electrical apparatus that provides emergency power to a load when the input power source or mains power fails.</p>\r\n\r\n<p><strong>AVR:</strong> Automatic Voltage Regulation is a feature of Line Interactive Topology. The unit control the voltage to a safe operating range. This is achieved by re-routing the input voltage through the internal Automatic Voltage Regulating transformer. The main advantage of this is that it helps to prolong the life of the equipment and extends the operating range.</p>\r\n\r\n<p><strong>TVSS:</strong>&nbsp;Transient Voltage Surge Suppression is to eliminate or reduce damage to data processing equipment and other critical equipment by limiting transient (surge) voltages and currents (surges) on electrical circuits.</p>\r\n\r\n<p><strong>ATS:</strong>&nbsp;Automatic transfer switch, is a device that automatically transfers a power supply from its primary source to a backup source when it senses a failure or outage in the primary source.</p>\r\n\r\n<p><strong>Cooling</strong></p>\r\n\r\n<p>As important as power, proper cooling in a data center allows your colocation servers, networking gear and other general equipment to function properly without overheating. Without proper ventilation &ndash; raised floors to evenly spread cooling, hot/cold isles &ndash; your server would burn up and cease to function. It is important to note, just as power supplies within a data center need to be redundant, cooling also needs to be redundant. The following equipment&rsquo;s related the Cooling system-</p>\r\n\r\n<p><strong>CAC:</strong>&nbsp;Comfort Air Cooling System, the most common <em>air</em> conditioning <em>system</em> uses a compressor cycle to transfer heat from room to the outdoors. The system used at Power Room.</p>\r\n\r\n<p><strong>ACP:</strong>&nbsp;Automatic Control Panel is a control panel for the CAC that operate automatically on schedule by using the ratings of temperature and control multiple CAC.</p>\r\n\r\n<p><strong>PAC:</strong>&nbsp;Precision Air Condition is designed for close temperature and humidity control. It provide high reliability for year-round operation, with the ease of service, system flexibility and redundancy necessary to keep the technology room up and running 24 hours a day. The advantages avail precise and quick processor-based temperature humidity control.</p>\r\n\r\n<p><strong>Environment Monitoring</strong></p>\r\n\r\n<p>Data center / Server Room serves a critical function in an organization as it controls the flow of data as well as the storage of such data for future use. A data center runs on a 24/7; so it is always supported with sufficient air conditioning system and uninterruptible power supplies. Due to its non-stop nature, a data center, requires the highest level of monitoring and data protection from malfunctions caused from damage to the Network Infrastructures. The most common environmental threats to server rooms are temperature, humidity, water leaks, human error, intrusion, vibration, and power outage. Many of these threats, such as temperature and humidity, are related, which complicates environment monitoring and heightens the need for an automated, sophisticated system. The following equipment&rsquo;s related the Environment Monitoring System-</p>\r\n\r\n<p><strong>EMS Server:</strong> A device which accommodate data by using attached sensors and generate alarm for the administrator to monitor and take initiatives as well.</p>\r\n\r\n<p><strong>Modem:</strong>&nbsp;A telecommunication equipment that enabled Internet at the time of failure the local system to remote contact.</p>\r\n\r\n<p><strong>EMS Sensors:</strong> Several sensor equipment like as Temperature &amp; Humidity, Shock &amp; Vibration, Water leakage that attached with EMS Server and generate data of the environment current situation</p>\r\n\r\n<p><strong>Fire Detection and Protection</strong></p>\r\n\r\n<p>Fire detection &amp; Protection systems for server rooms and data centers are essential to the room itself.&nbsp; A fire detection &amp; Protection system will automatically extinguish a fire without the need of human intervention.&nbsp; Fire detection &amp; Protection systems for data centers must be suitable for clean air environments, as server rooms and data centers are mostly occupied by personnel. The following equipment&rsquo;s related the Fire Detection and Protection System-</p>\r\n\r\n<p><strong>Heat and Smoke Sensor:</strong> The Sensor always sense and calculate the temperature and smoke by itself</p>\r\n\r\n<p><strong>Control System:</strong> Calculate the Data form the sensor and extinguish &amp; suppress the Gas agent automatically as preassigned system and generate alarm.</p>\r\n\r\n<p><strong>Gas agents:</strong> <strong>NAF&reg; S 125 </strong>is a <strong>UL Recognized and US EPA SNAP Listed</strong> gaseous extinguishing agent. It has a low order of toxicity. At typical design concentrations it can be safely used to protect normally occupied areas.</p>\r\n\r\n<p><strong>Manual extinguisher:</strong>&nbsp; <strong>Manual fire extinguishing equipment </strong>is a portable or fixed manual firefighting system if incase of need to use.</p>\r\n\r\n<p><strong>Grounding:</strong> A properly installed grounding system will send harmful currents away from data center equipment. It will bond metallic components to the system so that conductive materials are at a similar electrical potential in order to decrease current flow. If there is a difference between the potential of multiple component, current will flow. If this flow reaches equipment, it can cause damage. So utilize proper cable management techniques and bond all data center racks, ladder racks, cabinets, enclosures, cable trays and equipment to the system. There installed two Grounding system and those used separately for Electrical equipment and Networking equipment.</p>\r\n\r\n<p><strong>Provided extra but potential Protections</strong></p>\r\n\r\n<p><strong>VESDA System:</strong> VESDA (an abbreviation of Very Early Smoke Detection Apparatus) is a laser based smoke detection system. A VESDA detector is much like a vacuum cleaner. It sucks air from the protected environment via purpose built&nbsp;<strong>aspirating pipe and fittings</strong>&nbsp;and samples the quality of air passing through the VESDA detection laser chamber. The Following Facility will be achieved by the system-</p>\r\n\r\n<ul>\r\n	<li>Very Early Warning detection performance</li>\r\n	<li>Active vs passive detection performance</li>\r\n	<li>Cumulative detection performance</li>\r\n	<li>Predictable detection performance</li>\r\n	<li>Absolute detection performance with fixed calibration</li>\r\n	<li>Unaffected by airflow or temperature extremes when properly designed</li>\r\n	<li>Multiple alarm thresholds for staged response</li>\r\n	<li>Flexible monitoring configurations</li>\r\n</ul>\r\n\r\n<p><strong>Fail Safe:</strong> Another major component of data centers is fail safe measures for all basic equipment i.e. CD, HDD etc. within that data center. This means all data center need to maintain safe space wherein all those stored. It is highly important for data center to find those items as needed in time beside the hands. A protected file safe can provide the facility.</p>\r\n\r\n<p><strong>Video Surveillance &amp; Access Control:</strong> Due to the security systems of a data center need to function around the clock. A data center maintains 24/7/365 security staff, closed loop surveillance cameras, finger print access and visitor log books. We provide both of the video surveillance systems and Access Control System.</p>\r\n\r\n<p><strong>Dehumidifier:</strong> Dehumidifiers reduce humidity levels, generally an appliance which reduces the level of humidity in the air</p>', '<p><strong>&nbsp;Maintaining Availability and time: </strong>A Data Center Infrastructure solution provides a single repository to house of asset information. It enables consistent and accurate suppling keeping, and provides instant setup and installation to reduce the time. Though it was a remote location and all equipment was not localized, we arrange all phase by phase to ensure availability and reduce time of installation</p>\r\n\r\n<p><strong>Improving Utilization of Capacity (Power, Cooling, Space): </strong>In a data center it is almost impossible to understand how much space, power, and cooling you have; predict when will you run out, which is the best for a services, and just how much power is needed to ensure uptime and availability. We made a pre model and allocate space, manage power and network connectivity are key to discovering hidden capacity while better managing the capacity you do possess.</p>\r\n\r\n<p><strong>Reporting Reduced Operating Expenses: </strong>It&rsquo;s not enough to implement solutions that reduce operating expenses, we also have to prove it. Our reporting tools instantly aggregates data across several dimensions allowing operation <strong>expenses </strong>to quickly show the operational efficiency.</p>\r\n\r\n<p><strong>Improving Staff Productivity: </strong>Non-automated or manual systems require facilities and Technical staff to spend an extraordinary amount of time logging activities into spreadsheets. We automate the processes like workflow approvals and the assignment of technicians to make adds, moves, and changes. This also assists with provisioning and auditing, all while achieving operational savings.</p>', 1, '2018-07-22 16:20:44', '2018-08-05 13:36:06'),
