gle repository to house of asset information. It enables consistent and accurate suppling keeping, and provides instant setup and installation to reduce the time. Though it was a remote location and all equipment was not localized, we arrange all phase by phase to ensure availability and reduce time of installation</p>\r\n\r\n<p><strong>Improving Utilization of Capacity (Power, Cooling, Space):&nbsp;</strong>In a data center it is almost impossible to understand how much space, power, and cooling you have; predict when will you run out, which is the best for a services, and just how much power is needed to ensure uptime and availability. We made a pre model and allocate space, manage power and network connectivity are key to discovering hidden capacity while better managing the capacity you do possess.</p>\r\n\r\n<p><strong>Reporting Reduced Operating Expenses:&nbsp;</strong>It&rsquo;s not enough to implement solutions that reduce operating expenses, we also have to prove it. Our reporting tools instantly aggregates data across several dimensions allowing operation&nbsp;<strong>expenses&nbsp;</strong>to quickly show the operational efficiency.</p>\r\n\r\n<p><strong>Improving Staff Productivity:&nbsp;</strong>Non-automated or manual systems require facilities and Technical staff to spend an extraordinary amount of time logging activities into spreadsheets. We automate the processes like workflow approvals and the assignment of technicians to make adds, moves, and changes. This also assists with provisioning and auditing, all while achieving operational savings.</p>', 1, '2018-08-05 15:09:17', '2018-12-01 11:22:33'),
	(3, 2, 'Structured LAN', 'structured-lan', '<p>A Structured LAN System is the cabling, connectors and accessories that make up the LAN (Local Area Network) inside a building.&nbsp; At a minimum, this consists of a Router, Network Switch and Ethernet Cable.</p>\r\n\r\n<p>The customer place requirements for LAN Infrastructure which could provide multi-generational service support as the company&rsquo;s IT needs continue to evolve. GTCL spoken about the services from qualified vendors experienced in providing, installing Structured LAN at their different side office entire Bangladesh which address the following needs-</p>\r\n\r\n<ul>\r\n	<li>Highly available 24/7 operation</li>\r\n	<li>Provide universal transmission medium for data, voice and video for the active network equipment without any changes and improvements in the system.</li>\r\n	<li>Provide flexibility and scalability when you change the location of employees, departments or an increase in their number.</li>\r\n	<li>Gigabit Data Transferable Plan</li>\r\n	<li>Solid Backbone Connectivity for Building to&nbsp;Building</li>\r\n	<li>Mostly Organized and Standerd</li>\r\n</ul>', '<p><strong>Couper Cables:</strong> Category 6 UTP Solid Cable Horizontal LAN</p>\r\n\r\n<p><strong>Optical Fiber Cable:</strong> 4 &amp; 6 Core SO2 Optical Fiber Cable for Backbone</p>\r\n\r\n<p><strong>Distributing devices:</strong> Category 6 UTP Patch Panel, Category 6 Connectors &amp; Jacks, Category 6 Patch Cords, Wire Management Panel</p>\r\n\r\n<p><strong>Information Outlet:</strong> Category 6 Modular with Face Plate</p>\r\n\r\n<p><strong>Consolidation points:</strong> Network Racks and So on.</p>', '<p>As a part of many enterprises of large business there are some geographically isolated parts (separate office, building, even a complex of constructions), each of which has its own Administration. Depending on administrative division of the enterprise, functional filling of separate networks can different. On the other hand, the network of small remote office may at all contain its own policy or their quantity will be insignificant. Anyway, there will be a problem of general corporate resources sharing. Therefore, separate remote physical local networks need to be united in one logic <strong>wide area network.</strong></p>\r\n\r\n<p>We take a similar Cabling solution for all geographically distributed local network segments. Priority sensitive user station ensuring and available communication channels use general control of locally. Sync the local administration with central administration to provide and take off any instruction and changes. We completed qualitative analysis of GTCL requirements in the structured cabling system and its parameters. We develop the optimum solution using advanced materials and components. Provide explanatory documentation of the developed solution and an agreement with the customer. We start the implementation process according the previously prepared project documentation. And at last we provide customer with the executive documentation of the implemented system.</p>', 1, '2018-11-28 09:23:34', '2018-11-28 09:55:44'),
	(4, 2, 'End User Training', 'end-user-training', '<p><strong>ECL Systems Ltd</strong>. arranged specialized training for GTCLs end users so that the employees of GTCL can maximize the value of existing systems for their business and increase both productivity and efficiency. There are two type of Training contact for GTCL-</p>\r\n\r\n<ol>\r\n	<li>Microsoft Out Look 2016</li>\r\n	<li>Skype for Business</li>\r\n</ol>', '<p><img src="data:image/png;base64," style="float:right; height:174px; margin-left:15px; margin-right:15px; width:281px" /><strong>Microsoft Outlook 2016</strong></p>\r\n\r\n<p>Microsoft Outlook is an email client used to access&nbsp;Server email. Microsoft Outlook&nbsp;is a versatile component of the&nbsp;Microsoft Office&nbsp;for users to manage personal information and to communicate with others. It helps you in managing your email messages, appointments, contacts, and tasks, as well as making reminders and tracking activities.</p>\r\n\r\n<p>Outlook is a vital application in many organizations. A typical company can connect Outlook to an Exchange server, and everyone can share the same address book and calendars, making it a great tool for enterprise level collaboration.</p>\r\n\r\n<p>We arranged specialized training for GTCL so that the employees of GTCLs end users can group their expertise about Outlook 2016. This training from ECL Systems Ltd. helps them to use all of the latest features of this application, including:</p>\r\n\r\n<ul>\r\n	<li>Use email with Outlook 2016</li>\r\n	<li>Maintain schedule and calendar</li>\r\n	<li>Management of Contact, import/export.</li>\r\n	<li>Management of Today list and schedule reminder</li>\r\n	<li>Management of important Massage</li>\r\n	<li>Make a recurring meeting and Manage/response/decline meeting schedule</li>\r\n	<li>Task management; Assign/decline task</li>\r\n	<li>Mail &amp; Contact print</li>\r\n	<li>Using system of SharePoint through Outlook</li>\r\n	<li>Helpdesk communication system</li>\r\n</ul>\r\n\r\n<p>And so on...</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Skype for Business</strong></p>\r\n\r\n<p><img src="data:image/png;base64," style="float:right; height:165px; margin-left:15px; margin-right:15px; width:329px" />Microsoft Lync is now Skype for Business. The new Skype for Business platform offers a diverse set of features for businesses, including presence, instant messaging, voice and video calls, and online meetings. &nbsp;Training about Skype allow user to validate their expertise with this platform by helping users create a consistent communications experience for organization. This will help entire business connect with people and potential customers around the world so employees can expand and serve clientele everywhere.&nbsp;</p>\r\n\r\n<p>We arranged specialized training about Skype for Business. Skype for Business training from ECL Systems Ltd. helps them to use all of the latest features of this application, including:</p>\r\n\r\n<ul>\r\n	<li>Enhanced User Experience to using Skype start and end</li>\r\n	<li>Voice and Video Call making on an easy way</li>\r\n	<li>Attachment of Doc sending process and etc.</li>\r\n	<li>Schedule Calendar and reminder system</li>\r\n	<li>Online Conferencing</li>\r\n	<li>Mobile Support and On-The-Go Access</li>\r\n	<li>Improved Capabilities for Management of On-Premises Servers</li>\r\n	<li>System of Multi-Factor User Authentication</li>\r\n</ul>\r\n\r\n<p>And so on&hellip;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 1, '2018-12-01 11:10:45', '2018-12-01 11:14:14');
